public int task(int _taskId)
{
    #Task

    if (_taskId == #taskRefresh &&
        !isQueryExecuted)
    {
        // Workaround for platform paging issue
        FilterPaneControl filterPane = this.control(this.controlId(FilterPaneControl::DefaultName()));
        filterPane.ApplyFilter();

        return 0;
    }

    int ret = super(_taskId);

    return ret;
}

public container pack()
{
    return [#CurrentVersion, InventSum_ds.queryRun().pack()];
}

public boolean unpack(container packedClass)
{
    Version     version = RunBase::getVersion(packedClass);
    container   queryCon;

    switch (version)
    {
        case #CurrentVersion:
            [version, queryCon] = packedClass;
            if (SysQuery::isPackedOk(queryCon))
            {
                InventSum_ds.queryRun(new QueryRun(queryCon));
                return true;
            }
            break;
    }

    return false;
}

