public void run()
{
    super();

    //when opening from back/forward (history) do not display query form
    if (this.args().dataset() != tableNum(InventSum))
    {
        xSysLastValue::getLast(this);
        this.openFilterPane();
    }
}

public void openFilterPane()
{
    FilterPaneControl filterPane = this.control(this.controlId(FilterPaneControl::DefaultName()));

    filterPane.OpenFilterPane();
    filterPane.setFocus(); 
    messageId = Message::Add(MessageSeverity::Informational, "@CLIFiltering:FilterOnOpen_PleaseFilter");
}

private void refreshFormPart(str _formPartName)
{
    FormPartReferenceControl inventOnHandItemPart;

    if (formPartReferenceControlsMap.exists(_formPartName))
    {
        inventOnHandItemPart = formPartReferenceControlsMap.lookup(_formPartName);            
    }
    else
    {
        inventOnHandItemPart = element.getPartControlByName(_formPartName);
        //if the part does not exist we get null back, we still insert that in the cache to avoid determining it on each call
        formPartReferenceControlsMap.insert(_formPartName, inventOnHandItemPart);
    }

    if (inventOnHandItemPart  
        && inventOnHandItemPart.visible() 
        && inventOnHandItemPart.expanded())
    {
        inventOnHandItemPart.refresh();
    }    
}

private void refreshInventSumDependentFormParts()
{
    if (factBoxesEnabled)
    {
        this.refreshFormPart(formStr(InventOnHandItemPart));
        this.refreshFormPart(formStr(InventOnHandItemPartCW));
        this.refreshFormPart(formStr(InventOnHandItemPhysicalPart));
        this.refreshFormPart(formStr(InventOnHandItemCostPart));
        this.refreshFormPart(formStr(InventOnHandItemPhysicalPartCW));
        this.refreshFormPart(formStr(InventOnHandItemPreview));
    }
}

void updateDesign(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init          :
        case InventDimFormDesignUpdate::LinkActive    :
            element.inventDimSetupObject().initFromCaller();
            element.inventDimSetupObject().parmCtrlItemId(inventSum_ItemId);
            if (_mode == InventDimFormDesignUpdate::Init)
            {
                if (element.inventDimSetupObject().parmDimParmVisibleGrid().ItemIdFlag == NoYes::No)
                {
                    itemName.visible(false);
                }
            }
        // No break
        case InventDimFormDesignUpdate::Active        :
            element.inventDimSetupObject().formActiveSetup();
            element.inventDimSetupObject().formSetControls(true,false);
            //Form parts that are dependent on InventSum needs to be manually refreshed since a relation on itemId/inventDimId cannot be used.
            element.refreshInventSumDependentFormParts();
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

