void executeQuery()
{
    InventDimParm   dimParm;
    isQueryExecuted = true;
    element.inventDimSetupObject().modifyQuery(inventSum_DS, inventDim_DS);
    if (inventsum_ds.queryRun() && inventsum_ds.queryRun().query())
    {
        element.inventDimSetupObject().modifyQueryBasedOnDatasourceName(inventsum_ds.queryRun().query(),
                                                                        inventSum_DS.name(),
                                                                        inventDim_DS);
    }

    inventAvailabilityFormCache.refreshCache();

    super();

    Query query = inventsum_ds.queryRun().query();

    // Examine the query we just run and recalculate the visible dimensions if necessary.
    for (int idx = 1; idx <= query.groupByFieldCount(); idx++)
    {
        FieldId fieldId = query.groupByField(idx).fieldID();
        TableId tableId = query.groupByField(idx).dataSource().table();

        // If the field is invisible but it's a group by field in the query
        if (tableId == tableNum(InventSum) && fieldId == fieldNum(InventSum, ItemId))
        {
            dimParm.ItemIdFlag = NoYes::Yes;
        }
        else if (tableId == tableNum(InventDim))
        {
            fieldId = this.dim2dimParm(fieldId);
            dimParm.(fieldId) = NoYes::Yes;
        }
    }

    if (!InventDimParm::isInventDimParmEqual(dimParm, element.inventDimSetupObject().parmDimParmVisibleGrid()))
    {
        element.inventDimSetupObject().parmDimParmVisibleGrid(dimParm);
        element.updateDesign(InventDimFormDesignUpdate::Active);
    }

    if (messageId)
    {
        Message::Remove(messageId);
        messageId = 0;
    }
}

