display container displayInfoMessage(InventSum _inventSum)
{
    ImageReference  imageReference;
    if (inventOnhandDimensionDisplayHelper.shouldDisplayExplanationOfNonzeroPhysicalValueWithZeroInvent(_inventSum, element.inventDimSetupObject()))
    {
        imageReference = ImageReference::constructForSymbol(ImageReferenceSymbol::Info, inventOnhandDimensionDisplayHelper.constructExplanationOfNonzeroPhysicalValueWithZeroInventMessage(_inventSum, element.inventDimSetupObject()));
    }

    return imageReference ? imageReference.pack() : conNull();
}

